menuButton.addEventListener("click", () => openSideMenu());

howItWorkNotDisDivs.forEach(div =>
    div.addEventListener("click", (event) => {
        if (event.view.innerWidth < 1070) spanDivP(div);
    })
);

careerHeaderItem.addEventListener("click", (event) => {
    console.log("click on careerHeaderItem", event.view.innerWidth);
    if (event.view.innerWidth < 1070) {
       handleMenuCareerList()
     }
        
})	

function checkToCloseMenu(event) {
    if( mobileNav.classList.contains("open")) openSideMenu(false)
}

function createDomExpend(data, parentDiv) {
    let divHelf1 = document.createElement("div");
    divHelf1.classList.add("helf_div")
    let divHelf2 = document.createElement("div");
    divHelf2.classList.add("helf_div");

    Object.keys(data).forEach((q, index) => {
        let div = document.createElement("div");
        let lable = document.createElement("label");
        let p = document.createElement("p");

        let divT = document.createElement("div");
        let lableArrow = document.createElement("label");

        divT.classList.add("title_howitwork");
        div.classList.add("qa");
        
        lable.innerHTML = q;
        lableArrow.innerHTML = "&#10132";
        p.innerHTML = data[q];

        divT.appendChild(lable);
        divT.appendChild(lableArrow);
        div.appendChild(divT);
        div.appendChild(p);
        div.addEventListener("click", () => spanDivP(div));
        let indextToComp = Object.keys(data).length % 2 === 0 ? index : index + 1;
        if (Object.keys(data).length / 2 <= indextToComp)divHelf1.appendChild(div);
        else divHelf2.appendChild(div);
       
    });
    parentDiv.appendChild(divHelf1);
    parentDiv.appendChild(divHelf2);
}

function startLoopModal(time) {
    setTimeout(function () {
        openModal(true);
    }, time);
}

function openSideMenu(toOpen = true) {
    if ( mobileNav.classList.contains("open")) {
        mobileNav.classList.remove("open");
        menuButton.classList.remove("ex")
        handleMenuCareerList(false)
    } 
    else if(toOpen){
        mobileNav.classList.add("open");
        menuButton.classList.add("ex");
    }
}

function handleMenuCareerList(toOpen  = true) {
    if ( careerHeaderList.classList.contains("open")) {
        careerHeaderList.classList.remove("open");
    } else if(toOpen){
        careerHeaderList.classList.add("open");
    }
}

function openModal(toOpen) {
  console.log("showAlert", toOpen);

  if (toOpen) backdrop_modal.classList.add("open");
  else {
    backdrop_modal.classList.remove("open");
    startLoopModal(3000000);
  }
}

function submitContactUs(req) {
   showAlert()
}

function showAlert(isToCheck = true) {
    console.log("showAlert", isToCheck)
    backdrop_alert.style.display = isToCheck ? "flex" : "none"
}

function spanDivP(div) {
    div.querySelector("p").style.display =
        div.querySelector("p").style.display == "none" ? "block" : "none";
    div.querySelector("div label+label").style.transform =
      div.querySelector("div label+label").style.transform == "rotateZ(90deg)"
        ? "rotateZ(270deg)"
        : "rotateZ(90deg)";

}
